INSERT IGNORE INTO `products` (`code`, `active`, `type`, `item`, `description`, `price`, `gross_price`, `category`, `brand_id`, `route`, `items_on_box`, `product_type_id`, `supplier_id`, `cold_description`, `barcode`, `qrcode`, `minimum_stock`) VALUES
	(84, 1, NULL, '24K BIO-BRIGHTENING SKIN TONE MOISTURIZER SPF 30', 'The 24K Bio-Brightening Skin Tone Moisturizer SPF 30 is formulated to boost radiance while protecting skin from harsh UV rays. This weightless daytime cream also forms a protective veil over the skin to defend against moisture loss, keeping skin looking supple and baby-soft.', 100.00, 100.00, NULL, 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(85, 1, NULL, '24K BIO-BRIGHTENING DARK SPOT SOLUTION', 'The 24K Bio-Brightening Dark Spot Solution is a gentle formula made to reduce the appearance of blemishes, skin discoloration and age spots. This advanced nighttime formula contains Kojic Acid, vitamin A and vitamin C to brighten and balance out the overall skin tone. This unique blend will leave skin with a radiant glow.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(86, 1, NULL, '24K BIO-BRIGHTENING PIGMENT BALANCING MASK', 'The 24K Bio-Brightening Pigment Balancing Mask is formulated to reduce the appearance of age spots, sun damage and uneven skin tone. A combination of vitamin A, vitamin E, and mica helps to illuminate and balance the skin’s complexion. This unique complex restores the skin’s radiance while reducing the look of discoloration.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(87, 1, NULL, '24K COLLAGEN & SEAWEED MASK', 'The 24K Collagen & Seaweed Mask is a unique kaolin clay mask designed to restore the look of volume and smoothness to skin. Its blend of ingredients like safflower seed oil, collagen, Retinyl Palmitate and botanical extracts like sage extract, help to reduce the appearance of fine lines and wrinkles. Flecked with gold, this luxurious mask will leave your skin more vibrant and radiant in just one use.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(88, 1, NULL, '24K COLLAGEN RENEWAL CREAM', 'The 24K Collagen Renewal Cream’s unique formula helps to improve the appearance of skin firmness and restores lost moisture. Enriched with seaweed extract, green tea and aloe to leave your skin feeling soft and looking radiant. This cream will help reduce the appearance of fine lines and wrinkles while restoring skin’s moisture.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(89, 1, NULL, '24K COLLAGEN RENEWAL SERUM', 'The 24K Collagen Renewal Serum helps to restore skin’s youthful radiance. This serum’s humectant and collagen-boosting ingredients like Beta-Glucan, Sodium Hyaluronate, and peptides improve the appearance of volume and firmness while reducing the visibility of fine lines. Enhance your anti-aging efforts daily with this gentle gel.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(90, 1, NULL, '24K COLLAGEN PRE-MASK', 'The 24K Collagen Pre-Mask is a triple threat! This unique formula prepares your skin for the 24K Collagen & Seaweed Mask with three sensational phases. It starts as a gel, melts to an oil and then transforms into a milky foam. Melt away impurities and prepare your skin to take in the maximum beauty benefits from the 24K Collagen & Seaweed Mask.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(91, 1, NULL, '24K DMAE BODYLIFT CREAM', 'The 24K DMAE Bodylift Cream is a luxurious cream that promotes the appearance of a perfectly toned silhouette. It is enriched with rejuvenating ingredients like caffeine and DMAE to smooth and firm the look of sagging skin. This confidence-in-a-jar will leave skin with a tighter, more contoured appearance.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(92, 1, NULL, '24K DMAE DEEP WRINKLE TIGHTENING SOLUTION', 'The 24K DMAE Deep Wrinkle Tightening Solution is an innovative lightweight solution that helps tighten skin, reducing the look of fine lines and sagginess. It is infused with a superior blend of rejuvenating ingredients like DMAE and Hyaluronic Acid. Enjoy the feeling of a firmer and more youthful complexion.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(93, 1, NULL, '24K DMAE LIFTING & FIRMING CREAM', 'The 24K DMAE Lifting & Firming Cream gives skin a luminous and radiant glow. This non-greasy formula contains collagen, DMAE and vitamin C to diminish the look of wrinkles and fine lines, resulting in a more youthful appearance. Complement your daily skincare routine with this age-defying wonder.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(94, 1, NULL, '24K DMAE INSTANT STRETCHING MASK', 'The 24K DMAE Instant Stretching Mask is an indulgent weekly treat to promote skin elasticity. Its exquisite blend of beautifying oils includes jojoba and sunflower seed oil to smooth away wrinkles and fine lines while keeping skin moisturized. This mask instantly lends a firmer, smoother appearance to skin.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(95, 1, NULL, '24K VITAMIN C BOOSTER FACIAL SERUM', 'The 24K Vitamin C Facial Booster Serum instantly illuminates the complexion while reducing signs of tired-looking skin. Its unique formula is enriched with antioxidant-rich vitamin C and Retinyl Palmitate to target the appearance of dark spots, fine lines, and puffy-looking eyes. Flecked with gold, this serum is effective in boosting the skin’s overall glow.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(96, 1, NULL, '24K VITAMIN C FACIAL CLEANSER', 'The 24K Vitamin C Facial Cleanser is a gentle cleansing formula designed to remove traces of makeup, dirt and excess oils. Its soft foaming action is enriched with vitamin C, aloe vera and Retinyl Palmitate to thoroughly cleanse skin without stripping away vital moisture. This cleanser leaves skin feeling fresh and clean.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(97, 1, NULL, '24K MULTI-VITAMIN DEEP PEELING', 'The 24K Multi-Vitamin Deep Peeling is a unique exfoliating gel. Its superior formula combines Mandelic Acid and vitamin C to brighten overall skin tone, and bamboo stem powder to gently exfoliate skin. This peeling treatment will leave skin feeling clean and refreshed.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(98, 1, NULL, '24K DEEP MOISTURIZER', 'The 24K Deep Moisturizer has a light, non-greasy texture. Featuring well-established moisturizing ingredients like vitamin E and shea butter, this velvety cream slips smoothly onto skin to protect against moisture loss and restore the look of volume. Achieve a smoother, plumper appearance with this delightfully soft cream.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(99, 1, NULL, '24K OVERNIGHT CREAM', 'The 24K Overnight Cream is a lush moisture cream brimming with skin-reviving benefits. This botanical-rich multivitamin formula features sweet almond oil and shea butter to moisturize and soften skin while fortifying the skin’s natural barrier. Experience a renewed look of youthfulness as signs of dryness, fatigue and fine lines are diffused.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(100, 1, NULL, '24K CLASSIC BODY BUTTER', 'The 24K Classic Body Butter is a rich all-over-body moisturizer. Designed with a magnificent blend of ingredients such as sunflower oil and Shea butter to deliver a powerful moisturizing effect, daily use of this classic moisturizer will result in touchably soft skin. Suitable for dry skin types, this buttery formula leaves skin in luxuriously smooth comfort all day.', 100.00, 100.00, '1', 16, NULL, 24, 3, 1, '', NULL, NULL, NULL),
	(101, 1, NULL, '24K CLASSIC BODY SCRUB', 'The 24K Classic Body Scrub works to smooth and exfoliate skin for a renewed appearance. Its gentle antioxidant-rich formula removes dead skin cells and grime buildup while delivering skin-loving ingredients to the skin. Enjoy velvety soft skin immediately upon use.', 100.00, 100.00, '1', 16, NULL, 24, 3, 1, '', NULL, NULL, NULL),
	(102, 1, NULL, '24K MOUSSE CLEANSER', 'The 24K Mousse Cleanser transforms into a creamy lather to effectively remove impurities such as dirt and makeup. Formulated with willow bark and chamomile extract, this formula offers a deep botanical cleanse without stripping away the skin’s natural oils. This calming lather will leave skin feeling fresh and renewed.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(103, 1, NULL, '24K PURIFYING TONER', 'The 24K Purifying Toner is designed to be used after cleansing. Formulated with aloe vera juice and cucumber extract, this gentle tonic helps to refresh and balance the skin’s natural pH levels. This toner also helps to remove any remaining traces of excess oils and impurities to leave skin with a healthier-looking complexion.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(104, 1, NULL, '24K AROMATHERAPY BODY OIL', 'The 24K Aromatherapy Body Oil works to soothe skin all day long. Made with a blend of precious, nourishing oils and natural botanical extracts such as rosemary and pomelo grapefruit oils, this silky oil calms irritated skin and smooths away dry, rough patches. With no synthetic fragrance, this luxurious oil is specially formulated to leave skin feeling moisturized, healthy and radiant.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(105, 1, NULL, '24K CLASSIC HAND & BODY CREAM', 'The 24K Classic Hand and Body Cream is a lightweight moisturizer suitable for all skin types. Infused with organic argan oil and chamomile extract, this non-greasy cream helps to reinforce the skin’s natural barrier while soothing and moisturizing the skin. This multi-tasking cream offers a luxurious experience for satin-smooth skin.', 100.00, 100.00, '1', 16, NULL, 40, 3, 1, '', NULL, NULL, NULL),
	(106, 1, NULL, '24K RENEWAL LIP BALM', 'The 24K Renewal Lip Balm is enhanced with antioxidants and superior conditioners to moisturize and soothe dry, chapped lips. Avocado and sunflower seed oil work together to soften lips for a plumper, fuller look.', 100.00, 100.00, '1', 16, NULL, 40, 3, 1, '', NULL, NULL, NULL),
	(107, 1, NULL, '24K DEEP TISSUE REJUVENATION MASK & COLLAGEN EYE RENEWAL MASK', 'The 24K Deep Tissue Rejuvenation Mask & Collagen Renewal Mask is a boxed set of face and eye masks designed to promote skin elasticity. Expertly formulated with gold, lavender and collagen, this mask relaxes and calms skin while delivering vital ingredients to encourage a smoother, softer complexion. Experience a renewed glow with this radiance-boosting mask.', 100.00, 100.00, '1', 16, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(108, 1, NULL, '24K ANTI-AGING EYE SERUM', 'The 24K Anti-Aging Eye Serum helps firm the delicate skin around the eyes. It is specially formulated with Palmitoyl Oligopeptide and Ascorbic Acid (vitamin C) to leave skin feeling young and radiant. Revive the eye contour with this silky serum.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(109, 1, NULL, '24K MULTI-VITAMIN DAY MOISTURIZER + AMINO ACID', 'The 24K Multi-Vitamin Day Moisturizer + Amino Acid features amino acids that form the building blocks of proteins and play a key role in skin integrity. Formulated with white tea extract and organic chamomile, this non-greasy formula works to provide anti-aging benefits and reduce the look of wrinkles and fine lines. By providing a invisible veil over the skin, this daytime moisturizer also helps to prevent moisture loss, keeping skin looking plump and youthful.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(110, 1, NULL, '24K MULTI VITAMIN NIGHT NOURISHMENT + RETINOL', 'The 24K Multi-Vitamin Night Nourishment + Retinol harnesses the power of Retinol to offer the skin multiple benefits. Combining the anti-aging properties of Retinol and the antioxidant benefits of green tea extract and vitamin E, this nighttime treatment reduces the appearance of wrinkles, dark spots, and loose skin, while protecting the skin from moisture loss. Enhance your nightly anti-aging routine with this age-defying formula.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(111, 1, NULL, '24K MULTI-VITAMIN DEEP PEELING + MANDELIC ACID', 'The 24K Multi-Vitamin Deep Peeling + Mandelic Acid is a unique exfoliating gel designed to be gentle yet effective for all skin types. Formulated with superb ingredients such as bamboo stem powder, Mandelic Acid and vitamin C, these powerful ingredients will help gently exfoliate the skin, leaving it with a soft, refreshed sensation.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(112, 1, NULL, '24K INTENSIVE EYE SERUM', 'The 24K Intensive Eye Serum is a breakthrough solution that helps firm the delicate skin around eyes. It is designed with potent ingredients like Palmitoyl Oligopeptide and vitamin C to reduce the appearance of crow’s feet. Discover the softening properties of this silky lightweight serum and enjoy a more youthful look.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(113, 1, NULL, '24K DARK CIRCLE EYE SOLUTION', 'This extraordinary eye cream instantly diminishes the appearance of under eye dark circles, leaving your face looking brighter and younger. Formulated with Gold, Vitamin A (Retinyl Palmitate), a highly absorbent Vitamin C (Tetrahexyldecyl Ascorbate), as well as Vitamin E(Tocopheryl Acetate) and Allantoin to hydrate the delicate skin around the eye area.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(114, 1, NULL, '24K INTENSIVE EYE FORMULA CREAM', 'The 24K Intensive Eye Formula Cream is specifically designed to minimize the look of dark circles, puffy eyes, and crow’s feet. The powerful infusions of Retinyl Palmitate and caffeine work to promote skin elasticity around the eyes while giving skin a more rested appearance. Enjoy a fresher, more vibrant look with this moisturizing formula.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(115, 1, NULL, '24K NECK DUO TREATMENT', 'The 24K Neck Duo Treatment is a two-part system to care for the skin around the neck. The 24K Necklift Boosting Essence is fortified with Tocopheryl Acetate and Retinyl Palmitate to diminish necklace lines and age spots, while the 24K Necklift Nutri-Cream features jojoba seed oil and shea butter to lock in moisture and keep skin looking plump. Enjoy a smoother décolleté with this botanical-based blend of premium anti-aging ingredients.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(116, 1, NULL, '24K NECK LIFTING & CHEST FIRMING MASK', 'The 24K Neck Lifting and Chest Firming Mask is a revolutionary formula designed to give skin a more ‘lifted’ appearance. Infused with lavender oil, gold, aloe extract and collagen, this mask targets delicate skin around the neck and chest to reduce the appearance of wrinkles and dry skin. The boost of anti-aging actives promote the look of skin elasticity and firmness.', 100.00, 100.00, '1', 16, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(117, 1, NULL, '24K TÈRMICA® ENERGIZING MASK', 'The 24K Tèrmica® Energizing Mask provides a unique heating effect when applied onto skin. The heated formula maximizes the anti-aging benefits of vitamins A (Retinyl Palmitate), C (Ascorbic Acid) and E (Tocopheryl Acetate) to promote a fresh and energized appearance. This thermal mask will pamper skin and leave it beautifully radiant.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(118, 1, NULL, '24K TÈRMICA® COMPLETION CREAM', 'The 24K Tèrmica® Completion Cream is designed to target the signs of aging for a smoother, plumper appearance. Formulated with peptides Acetyl Hexapeptide-8 and Palmitoyl Oligopeptide, this cream helps to soften the appearance of wrinkles and fine lines. The moisturizing properties of this cream also defends against the loss of moisture and promotes a healthier, firmer look.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(119, 1, NULL, '24K TÈRMICA® ACTIVATION SERUM', 'The 24K Tèrmica® Activation Serum is a silky gel-like solution designed to reduce the appearance of wrinkles and fine lines. Formulated with witch hazel, green tea and seaweed, this radiance-boosting formula smooths away unwanted signs of aging for a brighter, rejuvenated appearance.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(120, 1, NULL, '24K TÈRMICA® HD SOLUTION', 'The 24K Tèrmica® HD Solution encourages a smooth photo-finish complexion, while diminishing the appearance of pores and fine lines. This targeted treatment delivers powerful infusions of cucumber, vitamin A and organic chamomile to promote softer-looking skin. This HD Solution provides a beautiful matte finish, brightening and illuminating the complexion.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(121, 1, NULL, '24K HD TOUCH', 'MAXIMISE YOUR SKINCARE’S POWERFUL ANTI-AGEING BENEFITS WITH THE 24K HD TOUCH. THIS CAREFULLY CRAFTED MASSAGER STIMULATES BLOOD CIRCULATION, INCREASES BLOOD FLOW AND INVIGORATES DEEP TISSUES TO PROMOTE HEALTHIER, SMOOTHER-LOOKING SKIN. WITH CONSISTENT DAILY USE, THE 24K HD TOUCH WILL RESULT IN VISIBLE IMPROVEMENTS IN THE APPEARANCE OF WRINKLES AND DEEP FACIAL LINES.', 100.00, 100.00, '1', 16, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(122, 1, NULL, '24K CRYOGENIC MAGNOLIFT MASK', 'The 24K Cryogenic MagnoLift Mask is a unique ‘lifting’ mask that transforms skin from tired and dull to bright and radiant. This luxurious formula delivers a combination of sunflower seed oil, rosemary leaf extract and coconut oil to moisturize and maintain skin suppleness. Lift away impurities while removing signs of fatigued skin with this lavish treatment.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(123, 1, NULL, '24K CRYOGENIC PEARL REVIVAL ELIXIR', 'Use the 24K Cryogenic Pearl Revival Elixir to refresh the look of dull, dry skin and reduce the appearance of fine lines and wrinkles. The combination of Gold and Mother of Pearl helps maintain a youthful appearance.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(124, 1, NULL, '24K CRYOGENIC CONTOUR EYE FIRMING', 'The 24K Cryogenic Contour Eye Firming delivers an intensive firming action for more youthful-looking eye contours. The superior blend of caffeine and green tea helps minimize the appearance of puffiness, fine lines and wrinkles. This rich yet non-greasy cream will give the eyes a smoother and more contoured appearance.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(125, 1, NULL, '24K CRYOGENIC RESTORATION CREAM', 'The 24K Cryogenic Restoration Cream is designed to deeply moisturize skin and protect it from future moisture loss. The expert combination of melon fruit extract, Retinyl Palmitate, and Alpha-Hydroxy Acids promotes skin elasticity while reducing the appearance of wrinkles and fine lines. This non-greasy, butter-smooth cream rekindles the skin’s natural radiance for a luminous overall glow.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(126, 1, NULL, '24K CRYOGENIC DIAMOND GOMMAGE', 'The 24K Cryogenic Diamond Gommage is a breakthrough leave-on formula that gently exfoliates the skin. Made with coconut, green tea and chamomile extract, this gommage removes dead skin cells and excess oils without drying out the skin. This unique exfoliator is a gentle yet effective way to stimulate and renew the complexion.', 100.00, 100.00, '1', 16, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(127, 1, NULL, 'THE OROGOLD 24K CLEOPATRA NANO REGIMEN', 'The 24K Cleopatra Nano Regimen is a three-part system created to provide unparalleled care for the skin. This collection results in a dewy, glowing look.  24K Cleopatra Nano Silk Cream – 50 g. / 1.69 oz. The 24K Cleopatra Nano Silk Cream is a satin-like moisturizer designed to instantly smooth away wrinkles and dry skin. Expertly formulated with Palmitoyl Tetrapeptide-7, vitamin E and Sodium Hyaluronate, this luxurious solution diminishes unwanted signs of aging while protecting skin from moisture loss. Experience a radiant, plump look with reduced visibility of fine lines.  24K Cleopatra Nano Serum – 80 ml. / 2.70 fl. oz., 1 bottle = 10 ml. / 0.34 fl. oz., 8 bottles The 24K Cleopatra Nano Serum is a silky elixir that reduces the look of wrinkles and fine lines. Its unique formula includes Acetyl Hexapeptide-8 and aloe vera to soften and smooth skin for a more luminous, vibrant complexion.  24K Cleopatra Gold Sheets – 8 envelopes (4 sheets per envelope) The 24K Cleopatra Gold Sheets are designed to enrich skin with the exquisite luxury and benefits of gold. Soothe and calm skin while reducing the appearance of fine lines with this four-sheet wonder, and enjoy a renewed radiance.', 100.00, 100.00, '1', 16, NULL, 8, 3, 1, '', NULL, NULL, NULL),
	(128, 1, NULL, '24K NANO DAY RECOVERY', 'The 24K Nano Day Recovery is a lightweight yet richly moisturizing formula created to promote skin elasticity. It is infused with skin-pepping ingredients such as Sodium Hyaluronate, vitamin A and seaweed extract to minimize the look of fine lines and protect against moisture loss. This gel-like cream will leave skin feeling soft and looking radiantly younger.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(129, 1, NULL, '24K NANO HYDRA SILK MASK', 'The 24K Nano Hydra Silk Mask is a radiance-boosting formula to keep skin looking plump and soft. Its infusions of vitamin E, Sodium Hyaluronate and açai fruit extract are activated when the mask transforms from a silky cream into water droplets. By targeting the signs of aging and reinforcing the skin’s natural barrier, this unique leave-on mask provides skin with a fuller, moisturized appearance.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(130, 1, NULL, '24K NANO ULTRA SILK SERUM', 'The 24K Nano Ultra Silk Serum is a feather-light waterless formula designed to give skin a plump, moisturized look. Infused with highly moisturizing ingredients such as sweet almond oil and seaweed extract, this silky solution helps to fortify the skin’s natural barrier while minimizing the appearance of wrinkles and frown lines. Discover a fuller, vibrant glow with this all-day wonder.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(131, 1, NULL, '24K NANO NIGHT RECOVERY', 'The 24K Nano Night Recovery’s revolutionary non-greasy formula is designed to care for skin while at rest. Combining the soothing properties of aloe vera and the antioxidant-rich green tea extract, this light and silky solution keeps skin soft and moisturized all night long. Recover the skin’s dewy glow with this nightly treatment.', 100.00, 100.00, '1', 16, NULL, 16, 3, 1, '', NULL, NULL, NULL),
	(132, 1, NULL, '24K NANO COLLECTION BAGS', 'The 24K Nano Collection is a transformative collection designed to target dry, dull, damaged skin for a more radiant and luminous glow.  24K Nano Day Recovery – 50 g. / 1.76 oz. The 24K Nano Day Recovery is a lightweight yet richly moisturizing formula created to promote skin elasticity. It is infused with skin-pepping ingredients such as Sodium Hyaluronate, vitamin A and seaweed extract to minimize the look of fine lines and protect against moisture loss. This gel-like cream will leave skin feeling soft and looking radiantly younger.  24K Nano Night Recovery – 50 ml. / 1.76 fl. oz. The 24K Nano Night Recovery’s revolutionary non-greasy formula is designed to care for skin while at rest. Combining the soothing properties of aloe vera and the antioxidant-rich green tea extract, this light and silky solution keeps skin soft and moisturized all night long. Recover the skin’s dewy glow with this nightly treatment.  24K Ultra Silk Serum – 50 ml. / 1.76 fl. oz. The 24K Nano Ultra Silk Serum is a feather-light waterless formula designed to give skin a plump, moisturized look. Infused with highly moisturizing ingredients such as sweet almond oil and seaweed extract, this silky solution helps to fortify the skin’s natural barrier while minimizing the appearance of wrinkles and frown lines. Discover a fuller, vibrant glow with this all-day wonder.  24K Nano Hydra Silk Mask – 100 g. Jar / 3.53 oz. The 24K Nano Hydra Silk Mask is a radiance-boosting formula to keep skin looking plump and soft. Its infusions of vitamin E, Sodium Hyaluronate and açai fruit extract are activated when the mask transforms from a silky cream into water droplets. By targeting the signs of aging and reinforcing the skin’s natural barrier, this unique leave-on mask provides skin with a fuller, moisturized appearance.', 100.00, 100.00, '1', 16, NULL, 100, 3, 1, '', NULL, NULL, NULL),
	(133, 1, NULL, 'Perfectio Silver', 'PEREFCTIO WILL REJUVENATE YOUR SKIN\'S APPEARANCE AND STRUCTURE USING DUAL ACTION TECHNIQUES, RED LED LIGHT, AND TOPICAL HEAT.  Perfectio uses red and infrared LEDs in the range of 640–840 nm.  The Perfectio™ is a FDA-cleared Class II medical device.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(134, 1, NULL, 'Recreo', 'Recreo is a hair growth device that uses low-level laser light therapy to reverse the gradual of hair production mechanisms, and initiates a process of renewal and rehabilitation.  The Recreo™ is a FDA-cleared Class II medical device', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(135, 1, NULL, 'Perfectio X', 'The Perfectio X is an innovative red and infrared LED light therapy device, designed to provide incredible anti-aging benefits as well as rejuvenates, tighten and strengthen your skin.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(136, 1, NULL, 'Silver Blue Treat Set', 'Inside the pro luxury kit, you get the Perfectio and Sapphire for your ultimate treat. A combination of red light therapy with blue light therapy for full body treatment and protection.', 100.00, 100.00, '1', 15, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(137, 1, NULL, 'WHITE PEARL DAY MOISTURIZER', 'Seal in the feeling of glam all day long. This exquisite moisturizer provides long-lasting hydration, keeping the delicate facial skin feeling soft and smooth. Star ingredient Sodium Hyaluronate provides the added benefit of plumper, fuller looking skin.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(138, 1, NULL, 'WHITE PEARL NIGHT CREAM', 'Define the meaning of ‘beauty sleep’ with this rich, yet non-greasy formula. Simply apply the cream before going to sleep. When you wake, you’ll discover a more refreshed and illuminated complexion worthy of the red carpet.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(139, 1, NULL, 'WHITE PEARL FACIAL CLEANSER', 'Experience the refreshing sensation! Lionesse Gem’s White Pearl Cleanser gently removes dirt, make up and excess oil with ingredients like Vitamin E (tocopheryl Acetate), Aloe and Chamomile Flower Extract (Chamomilla Recutita Flower Extract). This invigorating cleanser prepares your skin for the application of serum and cream.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(140, 1, NULL, 'WHITE PEARL FACIAL PEELING', 'Give your skin a fresh sensation with the White Pearl Facial Peeling. The unique combination of Pearl Powder and other rich ingredients, was designed to provide a powerful yet gentle facial cleanse and to gently remove make up and built up dirt. The White Pearl Facial Peeling will help achieve a smooth and radiant look.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(141, 1, NULL, '2-STEP CLEANSING KIT', 'Milk Cleanser: This soothing gentle Milk Cleanser is designed to remove unwanted dirt and excessive oils. It will purify the skin’s surface and leave a soft and hydrated sensation.     Skin Toner:  Formulated with a delicate blend for all skin types, the Skin Toner will soothe and relieve sensitive skin and will be the final step in your purifying system.', 100.00, 100.00, '1', 26, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(142, 1, NULL, 'AMBER DARK CIRCLE EYE CREAM', 'Your quest for the perfect dark circle eye cream ends here. Formulated with Vitamin A (Retinyl Palmitate), Vitamin E (Tocopheryl Acetate) and Caffeine, this light eye cream instantly reduces the appearance of dark circles and puffiness under the eye area for a brighter, well-rested look.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(143, 1, NULL, 'AMBER EYE CREAM', 'No matter where life takes you, there’s a cream to make it look like every step was a walk in the park. Reduce the appearance of under-eye puffiness with this light-weight eye cream. Formulated with Caffeine, Vitamin E (Tocopheryl Acetate) and Palmitoyl Tetrapeptide-7 this hydrating eye cream will leave your eyes looking well rested and relaxed.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(144, 1, NULL, 'AMBER EYE SERUM', 'This is your secret for defying gravity. This soothing, light serum reduces the appearance of fine lines and wrinkles with powerful ingredients like Palmitoyl Oligopeptide, Vitamin C (Ascorbic Acid) and Aloe, to leave the skin surrounding your eyes looking fuller and tighter.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(145, 1, NULL, 'AMBER NEW AGE SYRINGE', 'Formulated with Vitamin E (Tocopheryl Acetate), Hyaluronic Acid and Avocado Oil (Persea Gratissima Oil) this rich formula immediately reduces the look of deep wrinkles while moisturizing your skin with this innovative formulation and advanced application method.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(146, 1, NULL, 'BLACK ONYX CREAM', 'Behold ageless skin! The rich yet non-greasy cream reduces the appearance of aging with its advanced ingredients. Formulated with Collagen, Sodium Hyaluronate, Vitamin A (Retinyl Palmitate) and Vitamin C (Ascorbyl Palmitate) this cream will improve the appearance of inelastic skin.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(147, 1, NULL, 'BLACK ONYX SERUM', 'Do away with lines and wrinkles! Formulated with DMAE (Dimethylaminoethanol Tartrate), Sodium Hyaluronate, Vitamin C (Ascorbic Acid), and Vitamin A (Retinyl Palmitate), this silky serum reduces the signs of aging while nourishing your skin.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(148, 1, NULL, 'BLACK ONYX MASK', 'When applied to skin this unique formula has an instant warming effect to help eliminate dirt, oils and other skin damaging pollutants. Infused with Sweet Almond Oil (Prunus Amygdalus Dulcis Seed Extract) the skin will feel immediately softer to the touch.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(149, 1, NULL, 'GOLDEN SAPPHIRE CREAM', 'The Golden Sapphire Cream delivers moisturizing ingredients like Palmitoyl Oligopeptide and Olea Europaea Oil (Olive Oil) to your skin. The combination of Golden Sapphire and other precious ingredients are formulated to bring out your inner glow and return you to the blossoming complexion of your youth.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(150, 1, NULL, 'GOLDEN SAPPHIRE SOLIDIFYING PEEL-OFF MASK', 'Achieve a healthier appearance with the Golden Sapphire Peel-Off Mask. Everything you need for a glowing complexion is included in this indulgent boxed set. Formulated with gold, collagen and vitamins, the one of a kind mask solidifies upon application so you can peel your way to a radiant look.', 100.00, 100.00, '1', 26, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(151, 1, NULL, 'GOLDEN SAPPHIRE SERUM', 'The Golden Sapphire Serum has a lightweight consistency but acts like a heavyweight. The serum is infused with a highly concentrated formula of lavish ingredients like Golden Sapphire, Vitamin C (Ascorbic Acid), Palmitoyl Oligopeptide and Sodium Hyaluronate. It is designed to be used on areas of the face which you feel have deeper lines or wrinkles. Welcome back the soothed and smoothed skin of your youth.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(152, 1, NULL, 'GOLDEN SAPPHIRE LIQUÉFIER', 'This unique formula begins as a powder and transforms into a hydrating liquid, nourishing your skin with ingredients like Vitamin C (Ascorbyl Palmitate), Green Algae (Hydrolyzed Lola Implexa Extract), Seaweed (Alaria Esculenta Extract), this formula will leave your skin looking radiantly beautiful.', 100.00, 100.00, '1', 26, NULL, 10, 3, 1, '', NULL, NULL, NULL),
	(153, 1, NULL, 'DIAMOND REJUVENATION FACIAL AND EYE MASK', 'Reveal sparkling, rejuvenated skin! Formulated with the most indulgent and cutting edge ingredients, the Diamond Rejuvenation Facial and Eye Masks work to minimize the appearance of acne scars, fine lines, and other imperfections of the skin.  The package includes individually wrapped facial (14) and eye masks (12), enough for at least one luxurious spa-like experience each month.', 100.00, 100.00, '1', 26, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(154, 1, NULL, 'ULTIMATE DIAMOND LIFTING MASK', 'Restore a more youthful, lustrous-looking you with Diamond Ultimate Lifting Mask by Lionesse. This rich mask transforms before your eyes to bring luminosity and firmness to fatigued, lackluster skin.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(155, 1, NULL, 'DIAMOND NECK & FACE LIFT', 'The Diamond Neck & Face Lift is a sumptuously rich moisturizer, specially formulated to renew dry and fatigued skin. An extravagantly advanced emulsion, it will promote a more radiant complexion while smoothing away the appearance of lines and wrinkles.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(156, 1, NULL, 'DIAMOND DE-PUFFER', 'Infused with quality ingredients like Hyaluronic Acid, Acetyl Hexapeptide-8 and Mica, the Lionesse Diamond De-Puffer will help reveal your best eyes while eliminating under eye puffiness.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(157, 1, NULL, 'OPAL SHEER COLLAGEN SERUM', 'Instantly plump and soften the appearance of fine lines and wrinkles with Lionesse Opal Sheer Collagen Serum. Luxuriously lightweight, this delicate elixir absorbs easily to deliver a smoother and more youthfully supple look and feel to your skin.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
