	(202, 1, NULL, 'White Pearl Facial Cleanser', 'Recommended for use once per day. Begin by splashing your face with lukewarm water. Apply a small amount of product to the fingertips or a wash cloth, then gently massage onto the skin to create a luxurious lather. For best results, follow with the White Pearl Vitamin C Day Moisturizer or White Pearl Vitamin C Night Cream.', 100.00, 100.00, '1', 26, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(203, 1, NULL, 'ROYAL HONEY SHEET MASK', 'Revive dry and dehydrated skin for a renewed radiance with Venofye Royal Honey Sheet Mask. Each kit includes 10 individually packaged masks that can be used weekly to help revitalize the appearance of your skin. Its botanical blend is rich in the stimulating and moisturizing benefits of Honey and Sweet Almond Oil, leaving your skin dewy fresh, with a lusciously soft and supple look and feel.', 100.00, 100.00, '1', 7, NULL, 10, 3, 1, '', NULL, NULL, NULL),
	(204, 1, NULL, 'QUEEN BEE CLEANSING DUO', 'Venofye’s Queen Bee Cleansing Duo leaves your skin with a luminous, youthful glow while dissolving away makeup and impurities. Its gentle yet effective formula features a milk cleanser and softening toner which help to provide a deep, refreshing cleanse. Delivering anti-aging infusions of Bee Venom, Vitamin B3 and Hyaluronic Acid, the Queen Bee Cleansing Duo leaves your skin looking youthfully exuberant and with a smoother and more supple look and feel.', 100.00, 100.00, '1', 7, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(205, 1, NULL, 'QUEEN BEE FACIAL PEELING', 'Queen Bee Facial Peeling is designed to provide an intense yet gentle facial cleanse, to help keep skin supple. It combines the finest ingredients to assist with reducing the appearance of expression lines and wrinkles, leaving your skin feeling refreshed and rejuvenated.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(206, 1, NULL, 'QUEEN BEE DAY MOISTURIZER', 'Keep your skin feeling rejuvenated and refreshed with the outstanding Queen Bee Day Moisturizer. The rare combination of ingredients in this moisturizer will assist in rejuvenating and plumping up your complexion. The Queen Bee Day Moisturizer is designed to help reduce the appearance of wrinkles and fine lines, leaving your skin with a luminous and vibrant look.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(207, 1, NULL, 'QUEEN BEE OVERNIGHT THERAPY', 'Queen Bee Overnight Therapy is a lightweight cream enriched with a complex of green tea and vitamins A and E. It helps soothe and nourish the skin to look beyond radiant.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(208, 1, NULL, 'QUEEN BEE NECK LIFT', 'Use the Queen Bee Neck Lift to give your neck the care it deserves. This unique cream is infused with rich and beneficial ingredients to reduce the appearance of wrinkles and smooth the look of loose skin along the neckline. The Queen Bee Neck Lift will leave you with a younger and tighter look.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(209, 1, NULL, 'QUEEN BEE VITAMIN C SERUM', 'Indulge yourself with this powerful serum to intensify results from the Queen Bee collection. Formulated with two forms of Vitamin C (Tetrahexyldecyl Ascorbate and Ascorbyl Palmitate) this lavish serum will leave your skin feeling soft and looking radiant.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(210, 1, NULL, 'Clarifying Cream Cleanser', 'This gentle cleanser transforms into a creamy lather to effectively diminish the look of impurities such as dirt and makeup. Add our unique milk cleanser to your skin care regimen to leave your skin feeling radiant and smooth.', 100.00, 100.00, '1', 7, NULL, 24, 3, 1, '', NULL, NULL, NULL),
	(211, 1, NULL, 'QUEEN BEE COLLECTION + AGELESS ENERGIZING MASK +JELESSI V2+ AMBER', 'Venofye’s Queen Bee Collection provides users with all the daily essentials needed to help keep skin looking young and vibrant. Each product in this collection holds a vital step to bettering your skin’s healthy appearance. From the Queen Bee Clarifying Cream Cleanser to the Queen Bee Overnight Therapy, this collection will help your skin look and feel its best. To help better improve your skin’s appearance, the Jelessi Torche V2+, a handy device that helps stimulate collagen production, is also included.  This collection includes 9 products: Queen Bee Facial Peeling, Queen Bee Cleansing Duo, Queen Bee Day Moisturizer, Queen Bee Clarifying Cream Cleanser, Queen Bee Vitamin C Serum, Queen Bee Neck Lift, Queen Bee Overnight Therapy, Queen Bee Neck & Chest Mask, Ageless Energizing Mask and the Jelessi Torche V2+.', 100.00, 100.00, '1', 7, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(212, 1, NULL, 'QUEEN BEE NECK & CHEST MASK', 'The Venofye Queen Bee Neck & Chest Mask will target the complex and delicate areas many of us tend to forget. Pamper your Neck and chest with this unique mask formulated with Lavender Oil, Bee Venom, Aloe extract and Collagen. This boost of nourishing ingredients will help reverse signs of aging and reduce the appearance of wrinkles and inelastic skin.', 100.00, 100.00, '1', 7, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(213, 1, NULL, 'DRONEBEE MEN’S AFTER SHAVE BALM', 'Use the DroneBee Men’s After Shave Balm to help soothe and calm your skin after shaving. This unique After Shave Balm is infused with the finest ingredients to help you restore comfort back to your skin. The DroneBee Men’s After Shave Balm will leave your skin with a refreshed and silky smooth sensation.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(214, 1, NULL, 'DRONE BEE PRE- SHAVE GEL', 'The Drone Bee Pre- Shave Gel is an essential lightweight shave gel that helps soothe and protect skin from razor burn, nicks and cuts to create the perfect shaving experience.', 100.00, 100.00, '1', 7, NULL, 60, 3, 1, '', NULL, NULL, NULL),
	(215, 1, NULL, 'Drone Bee Men’s Tool Kit', 'Venofye’s Drone Bee Men’s Tool Box offers a complete lineup of professional-quality shaving products to transform your look from rugged to sharp. The centerpiece of this set is a retro-style safety razor that has been updated with patented design to help quickly achieve the closest shave possible. Paired with Venofye’s venom-infused anti-aging Drone-Bee Pre-Shaving Gel, Drone-Bee Men’s Balm for after shave relief, your skin will instantly feel softer, smoother and refreshingly soothed.', 100.00, 100.00, '1', 7, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(216, 1, NULL, 'DroneBee Men\'s Day Moisturizer', NULL, 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(217, 1, NULL, 'ROYAL JELLY EYE BEELIFT', 'With Venofye’s most powerful eye treatment, you can erase the appearance of puffiness using our innovative applicator. The Royal Jelly BeeLift was inspired by state-of-the-art technologies in lifting procedures. Wake up tired eyes and see a youthful glow that you’ll love!', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(218, 1, NULL, 'ROYAL JELLY BEE LUMINESCENT EYE SERUM', 'The Royal Jelly Bee Luminescent Eye Serum is designed to reduce the appearance of fine lines and wrinkles surrounding the eye area. Rich, yet quickly absorbed, this eye serum was formulated with Bee Venom, Palmitoyl Oligopeptide and Vitamin C (Ascorbic Acid) to help reduce the signs of aging.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(219, 1, NULL, 'Royal Jelly Bee Firming Eye Cream', 'The Royal Jelly Bee Eye Firming Cream is formulated with caffeine, Shea butter, vitamin E (Tocopheryl Acetate) and green tea to energize the skin under your eyes and diminish the look of puffiness and fine lines. Achieve the fresh, well-rested look everyone wants with this remarkable cream.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(220, 1, NULL, 'ROYAL JELLY BEE EYE REJUVENATION MASK', 'Refresh and awaken your eyes with the Venofye Royal Bee Eye Rejuvenation mask. This invigorating eye mask helps eliminate signs of fatigue using a breakthrough formula with a blend of Bee Venom, essential oils and vitamins.', 100.00, 100.00, '1', 7, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(221, 1, NULL, 'APITOXIN COLLAGEN CREAM', 'Use the Apitoxin Collagen Cream to enrich your skin care routine. It is infused with the finest ingredients to help reduce the appearance of fine lines and wrinkles. This unique moisturizer will leave your skin feeling soft and supple with a revitalized look.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(222, 1, NULL, 'APITOXIN COLLAGEN NIGHT RECOVERY', 'Enhance your skin care routine with the Apitoxin Collagen Night Recovery. Enjoy this beautifying rich blend and wake up to a smooth, soft and refreshed feeling in the morning. Infused with ingredients chosen especially to plump up your skin, it’ll assist in reducing the appearance of wrinkles and fine lines.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(223, 1, NULL, 'APITOXIN COLLAGEN MASK', 'Use the Apitoxin Collagen Mask as part of your skin care routine. This extraordinary mask is designed with rare ingredients to help reduce the appearance of fine lines and restore the volume to aging skin. The Apitoxin Collagen Mask will leave your skin with a revived and refreshed sensation.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(224, 1, NULL, 'ORCHARD BEE ELEVATING & BALANCING MASK', 'The Orchard Bee Elevating & Balancing Mask is formulated with ingredients such as DMAE, Bee Venom, Vitamins A (Retinyl Palmitate) and E. This remarkable mask is designed to target your main anti-aging concerns and give you a more youthful and radiant appearance.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(225, 1, NULL, 'ORCHARD BEE DARK SPOT SOLUTION', 'This velvety serum is designed to help reduce the appearance of age spots, freckles and any pigmentation that can occur when our skin is exposed to the damage of progressive sun exposure.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(226, 1, NULL, 'ORCHARD BEE BRILLIANCE CREAM SPF 30', 'This lightweight spot correcting day cream is supercharged with an advanced brightening complex. Use the Orchard Bee Brilliance Cream to improve and illuminate your complexion while the SPF 30 protects your skin from the sun’s harmful rays.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
