	(228, 1, NULL, 'VIPERLIFT BIO SERUM', 'The breakthrough ViperLift Bio Serum has a unique formula designed to assist in lessening the appearance of wrinkles and fine lines. Infused with rich ingredients to help achieve a smooth relaxed complexion, this powerful serum will leave you with a soft and radiant look.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(229, 1, NULL, 'VIPERLIFT BIO SYRINGE', 'Infused with vitamin E (Tocopheryl Acetate) and Sodium Hyaluronate, this one of a kind formula helps reduce the look of deep wrinkles with an innovative formulation and advanced application method.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
