	(231, 1, NULL, 'IRON BEE BOOSTING SERUM', 'Venofye Iron Bee Boosting Serum helps to dynamize the energizing and anti-aging effects of the Iron Bee Magnetic Mask. Blending an invigorating combination of Bee Venom, with Collagen, Vitamin C and Hyaluronic Acid, this powerful serum will help create the capstone of a transformative treatment, leaving your skin looking smoother, softer and with an age-defying glow.', 100.00, 100.00, '1', 7, NULL, 20, 3, 1, '', NULL, NULL, NULL),
