	(248, 1, NULL, 'VENUS SENSITIVE DAY CREAM', 'Our Venus Sensitive Day Cream is infused with meteorite powder and the most delicate ingredients to suit sensitive skin. This unique blend of aloe barbadensis leaf extract, retinyl palmitate, and palmitoyl hexapeptide-12 will ease away the appearance of wrinkles to create a more youthful and luminous look.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(249, 1, NULL, 'VENUS SENSITIVE EYE SERUM', 'Give your sensitive skin the care it deserves with the Venus Sensitive Eye Serum. Formulated with green tea extract and Palmitoyl Tetrapeptide-7, this powerful eye serum will help diminish the appearance of wrinkles and fine lines around your eyes.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(250, 1, NULL, 'VENUS SENSITIVE EYE CREAM', 'Experience the Venus Sensitive Eye Cream for sensitive skin.  This light-weight under-eye cream is formulated with advanced agents such as palmitoyl tetrapeptide-7 and caffeine, to gently help smooth and minimize the appearance of distressed and puffy eyes.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
