	(252, 1, NULL, 'VENUS CLEANSING MOUSSE', 'Venus Cleansing Mousse by Celestolite is a rich, foamy mousse that will purify and refresh your skin for a brighter more youthful glow.', 100.00, 100.00, '1', 10, NULL, 24, 3, 1, '', NULL, NULL, NULL),
	(253, 1, NULL, 'VENUS DAILY RENEWAL CLEANSING KIT', 'Venus Daily Renewal Cleansing Kit from Celestolite offers an invigorating and refreshing cleansing experience that leaves your skin with a clearer and more luminous looking appearance. This lush, moisturizing duo is suitable for all skin types and delivers essential anti-aging elements in the form of Meteorite Powder and Vitamin B3 while it gently clears away traces of makeup, dirt and other impurities from your skin without irritation or dryness.', 100.00, 100.00, '1', 10, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(254, 1, NULL, 'VENUS NIGHT CREAM', 'Restore a softer, smoother and more refreshed look and feel to your skin with Venus Night Cream from Celestolite. This luxuriously lightweight cream is formulated with powerful anti-aging vitamins and botanical extracts. Use nightly and awaken to a luminously youthful appearance to your skin and a visible reduction in signs of fine lines and wrinkles.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
