	(257, 1, NULL, 'JADE SPECTRA PHYTO SILK', 'The Jade Spectra Phyto Silk is a delicate blend of rare meteorite powder, collagen, and vitamins A and E (Retinyl Palmitate and Tocopheryl Acetate). This unique moisturizer reduces the appearance of fine lines and wrinkles, while delivering much-needed vitamins and nutrients — leaving your skin looking healthier and more youthful. It is the perfect finale to your Celestolite Jade Spectra skincare regimen.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
