	(260, 1, NULL, 'JADE SPECTRA BEAD SERUM', 'The Jade Spectra Bead Serum is infused with Acetyl Hexapeptide-8, vitamin E (Tocopheryl Acetate) and green tea extract (Camellia Sinensis Leaf Extract) to help smoothen and reduce the appearance of fine lines and wrinkles to give your skin a more youthful look.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(261, 1, NULL, 'COSMIC FIRMING SERUM', 'The Cosmic Firming Serum is enriched with vitamin C (Ascorbic Acid), meteorite powder and DMAE (Dimethylaminoethanol Tartate). This powerful serum is ideal for reducing the appearance of fine lines and wrinkles and will leave your skin looking young and luminous.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(262, 1, NULL, 'COSMIC FIRMING MASK', 'The Cosmic Firming Mask by Celestolite is formulated with vitamin A (Retinyl Palmitate), Collagen and DMAE (Dimethylaminoethanol Tartate). This rich anti-aging blend will help improve the appearance of skin’s elasticity and firmness.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
