	(272, 1, NULL, 'LUNA LUMINOUS TOUCH', 'This specialized skin-transforming solution contains Hyaluronic Acid, to immediately plump and smooth out your skin, minimizing imperfections. Infused with Retinyl Palmitate and a cocktail of powerful botanicals, Luna Luminous Touch works vigorously to refine trouble spots over time, leaving you with an age-defying, radiant complexion.', 100.00, 100.00, '1', 10, NULL, 20, 3, 1, '', NULL, NULL, NULL),
