	(340, 1, NULL, '2 Step Cleansing Kit', 'Resveratrol Milk Cleanser The Resveratrol Milk Cleanser is designed especially for delicate skin. It is formulated to gently remove make up and impurities while leaving your skin feeling soft and refreshed. For best results, follow with Resveratrol Balance Toner.  Resveratrol Balance Toner Vine Vera’s Balance Toner helps remove dirt and oil while leaving your skin with an even and radiant look. Use daily, prior to day cream.', 100.00, 100.00, '1', 23, NULL, 12, 3, 1, '<p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><span style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">Discover a new way to achieve fresh, clean skin with this cleansing duo. The Resveratrol Cleansing Kit comprises of two cleansing products.</span></p><p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><b>Resveratrol Milk Cleanser&nbsp;</b><br><span style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">Specifically designed for delicate skin, this cleanser gently rids the skin of makeup and grime buildup. This product also delivers a potent mixture of skin care benefits, including the anti-aging and antioxidant properties of Resveratrol.</span></p><p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><b>Resveratrol Balance Toner&nbsp;</b><br><span style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">Maximise your skin care products by first applying this skin-balancing toner, which removes dirt and oil that prevents the absorption of anti-aging and antioxidant ingredients.</span></p><p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><b>How to Use</b></p><p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><b>Resveratrol Milk Cleanser</b><br><span style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">Apply generously on a cotton ball and move around face and neck areas. Repeat until skin is clean. Use daily.</span></p><p style="border: 0px; font-family: Lato, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 1.03em; padding: 0px; vertical-align: baseline; line-height: 1.5; text-align: justify; color: rgb(115, 115, 115); font-variant-ligatures: normal; orphans: 2; widows: 2;"><b>Resveratrol Balance Toner&nbsp;</b><br><span style="border: 0px; font-family: inherit; font-style: inherit; margin: 0px; padding: 0px; vertical-align: baseline;">Soak a cotton ball and gently wipe across face and neck area. Repeat as needed. Use daily.</span></p>', NULL, NULL, NULL),
	(341, 1, NULL, 'Resveratrol Eye Collection Age Defying Eye Serum', 'This light and smooth eye serum is designed to reduce the appearance of fine lines and wrinkles surrounding the eye area. Rich, yet non-greasy, this eye serum was formulated with Resveratrol Ferment extract, green tea extract (Camellia Sinensis Leaf Extract) and vitamin C (Ascorbic Acid) derivative to help reduce the signs of aging.', 100.00, 100.00, '1', 23, NULL, 20, 3, 1, '', NULL, NULL, NULL),
