	(343, 1, NULL, 'Resveratrol Sauvignon Blanc Neck & Chest Mask', 'Pay attention to the areas of your skin that you may not think to look at — your chin, neck and chest. These areas may secretly give away your real age. The Sauvignon Blanc Collection contains Resveratrol, Hyaluronic Acid and Glycerol, balanced to give your skin the right amount of nutrients and moisture to improve elasticity and tone.', 100.00, 100.00, '1', 23, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(344, 1, NULL, 'Resveratrol Sauvignon Blanc Neck & Chest Cream', 'The neck and chest area is one of the most exposed areas of the body, but is one of the most ignored parts of our skin care regimen. This rich formula helps fight the signs of over-exposure to the sun’s harmful rays and overall aging. The combination of Resveratrol Ferment extract, Sodium Hyaluronate Vitamin E (Tocopheryl Acetate) and Vitamin A (Retinyl Palmitate) derivatives will help reduce the appearance of deep wrinkles and aging of the neck and chest area.', 100.00, 100.00, '1', 23, NULL, 12, 3, 1, '', NULL, NULL, NULL),
	(345, 1, NULL, 'Resveratrol Men’s After Shave Balm', 'Resveratrol Men’s After-Shave Balm was formulated for any man who does not want razor bumps or post-shave irritation. Let your skin soak in all the nourishing ingredients, keeping your skin feeling soft, hydrated and younger-looking.', 100.00, 100.00, '1', 23, NULL, 12, 3, 1, '', NULL, NULL, NULL),
