	(411, 1, NULL, 'XXL Paper Bag for Suitcase', NULL, 100.00, 100.00, '1', 23, NULL, 25, 3, 1, '', NULL, NULL, NULL),
	(412, 1, NULL, 'Perfectio Gold', 'The limited edition has a combination of more powerful Infrared LEDs that will provide deeper and more effective treatment to all skin layers. The Perfectio plus comes with a lifetime warranty for both online and in store customers. The most powerful home use anti-wrinkle device.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(413, 1, NULL, 'Perfectio Gold & Blue', 'Inside the pro luxury kit, you get the Perfectio Plus and Sapphire for your ultimate treat. A combination of red light therapy with blue light therapy for full body treatment and protection.', 100.00, 100.00, '1', 15, NULL, 5, 3, 1, '', NULL, NULL, NULL),
	(414, 1, NULL, 'Perfectio Blue', 'The Sapphire blue light is safe and effective skin care technology that helps your skin to look clearer and will minimize the appearance of blemishes. The Sapphire uses blue light therapy and topical heat to disinfect, detoxifies and eliminates bacteria under the skin, by that revealing a smoother healthier complexion that will help your skin tone to appear more even.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(415, 1, NULL, 'Perfectio X Gell', 'Red Algae\'s main benefit is its ability to promote healthy circulation in the body, regulate blood sugar ,It is also a rich source of calcium and magnesium so it contributes to bone health and since it is loaded with antioxidants it helps boost the immune system and nourishes the skin.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(416, 1, NULL, 'Elevare Skin Ivory', 'Give your skin the ultimate glow with Ivory, the newest skincare device from Elevare.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(417, 1, NULL, 'Elevare Skin Gold', 'Clinically proven and dermatologist recommended, the Elevare Plus + uses red and infrared light and topical heating to rejuvenate the skin – all without side effects.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(418, 1, NULL, 'Elevare Skin Silver', 'Clinically proven and dermatologist recommended, the Elevare Limited Edition uses red and infrared light as well as topical heating to rejuvenate the skin – all without side effects.', 100.00, 100.00, '1', 15, NULL, 20, 3, 1, '', NULL, NULL, NULL),
	(419, 1, NULL, 'Grandio Device', 'Grandio is a self-treatment device designed to deal with hair loss, thinning hair and baldness. By using the Grandio device for just 5 to 8 minutes a day at home, in the office or anywhere else, you will see amazing results in just a few months.', 100.00, 100.00, '1', 15, NULL, 6, 3, 1, '', NULL, NULL, NULL),
	(420, 1, NULL, 'Cartridge Short', 'Replaceable cartridge for GRANDIO device. 2 options according to your hair length. 8 Discs Short Hair Cartridge or 4 Discs Long Hair Cartridge', 100.00, 100.00, '1', 15, NULL, NULL, 3, 1, '', NULL, NULL, NULL),
	(421, 1, NULL, 'Cartridge Long', 'Replaceable cartridge for GRANDIO device. 2 options according to your hair length. 8 Discs Short Hair Cartridge or 4 Discs Long Hair Cartridge', 100.00, 100.00, '1', 15, NULL, NULL, 3, 1, '', NULL, NULL, NULL);
